    b0 = b[4];
    b1 = b[5];
    b2 = b[6];
    b3 = b[7];
    this.m10 = b0 * a00 + b1 * a10 + b2 * a20 + b3 * a30;
    this.m11 = b0 * a01 + b1 * a11 + b2 * a21 + b3 * a31;
    this.m12 = b0 * a02 + b1 * a12 + b2 * a22 + b3 * a32;
