    accumOutlinePixel(fragCoord+vec2( 2, 1), res); // WWN
    accumOutlinePixel(fragCoord+vec2( 2,-1), res); // WWS
    accumOutlinePixel(fragCoord+vec2( 1,-2), res); // SSW
    accumOutlinePixel(fragCoord+vec2(-1,-2), res); // SSE

